import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';

const App = () => {
  const [weatherData, setWeatherData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios('http://159.65.154.81:80/data');
      setWeatherData(result.data);
    };

    fetchData();
  }, []);

  const data = {
    labels: weatherData.map((data) => data.time),
    datasets: [
      {
        label: 'Temperature',
        data: weatherData.map((data) => data.temperature),
        borderColor: 'rgba(75, 192, 192, 1)',
        fill: false,
      },
      {
        label: 'Humidity',
        data: weatherData.map((data) => data.humidity),
        borderColor: 'rgba(153, 102, 255, 1)',
        fill: false,
      },
      {
        label: 'AQI',
        data: weatherData.map((data) => data.aqi),
        borderColor: 'rgba(255, 159, 64, 1)',
        fill: false,
      },
      {
        label: 'Heat Index',
        data: weatherData.map((data) => data.hi),
        borderColor: 'rgba(255, 99, 132, 1)',
        fill: false,
      },
      {
        label: 'Raining',
        data: weatherData.map((data) => (data.raining ? 1 : 0)),
        borderColor: 'rgba(54, 162, 235, 1)',
        fill: false,
      },
      {
        label: 'WiFi Strength',
        data: weatherData.map((data) => data.wifiStrength),
        borderColor: 'rgba(255, 206, 86, 1)',
        fill: false,
      },
    ],
  };

  const handleBoxClick = (sensor) => {
    const filteredData = weatherData.filter((data) => data[sensor]);
    const labels = filteredData.map((data) => data.time);
    const dataPoints = filteredData.map((data) => data[sensor]);

    const chartData = {
      labels,
      datasets: [
        {
          label: sensor,
          data: dataPoints,
          borderColor: 'rgba(75, 192, 192, 1)',
          fill: false,
        },
      ],
    };

    // Display the chart in a modal or a new page
    // ...
  };

  return (
    <div>
      <h1>Weather Data</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
            boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('temperature')}
        >
          <h2>Temperature</h2>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].temperature : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
           boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('humidity')}
        >
          <h2>Humidity</h2>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].humidity : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
            boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('aqi')}
        >
          <h2>AQI</h2>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].aqi : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
            boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('hi')}
        >
          <h2>Heat Index</h2>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].hi : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
            boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('raining')}
        >
          <h2>Raining</h2>
          <p>{weatherData.length > 0 ? (weatherData[weatherData.length - 1].raining ? 'Yes' : 'No') : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
        <div
          style={{
            width: '200px',
            height: '200px',
            border: '1px solid black',
            margin: '10px',
            padding: '10px',
            boxSizing: 'border-box',
          }}
          onClick={() => handleBoxClick('wifiStrength')}
        >
          <h2>WiFi Strength</h2>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].wifiStrength : 'N/A'}</p>
          <p>{weatherData.length > 0 ? weatherData[weatherData.length - 1].time : 'N/A'}</p>
        </div>
      </div>
      <Line data={data} />
    </div>
  );
};

export default App;
